import React, { useEffect, useState } from 'react';
import styles from './ComponentsLogin.module.css';

function ComponentsLogin() {
    const [userType, setUserType] = useState('');
    const [showAlert, setShowAlert] = useState(false);

    // Função para adicionar animação de fade-in
    const fadeIn = (element) => {
        element.style.opacity = 0;
        element.style.display = 'block';
        let op = 0.1;
        const timer = setInterval(() => {
            if (op >= 1) {
                clearInterval(timer);
            }
            element.style.opacity = op;
            op += op * 0.1;
        }, 10);
    };

    // Função para adicionar animação de fade-out
    const fadeOut = (element) => {
        let op = 1;
        const timer = setInterval(() => {
            if (op <= 0.1) {
                clearInterval(timer);
                element.style.display = 'none';
            }
            element.style.opacity = op;
            op -= op * 0.1;
        }, 10);
    };

    useEffect(() => {
        const clienteSection = document.getElementById('cliente-section');
        const funcionarioSection = document.getElementById('funcionario-section');

        if (userType === 'cliente') {
            fadeOut(funcionarioSection);
            fadeIn(clienteSection);
        } else if (userType === 'funcionario') {
            fadeOut(clienteSection);
            fadeIn(funcionarioSection);
        } else {
            fadeOut(clienteSection);
            fadeOut(funcionarioSection);
        }
    }, [userType]);

    const handleSubmitCliente = (e) => {
        e.preventDefault();
        const cnpj = document.getElementById('cnpj').value;
        if (!cnpj) {
            setShowAlert(true);
        } else {
            setShowAlert(false);
            console.log('CNPJ enviado:', cnpj);
            // Aqui você pode implementar a lógica de redirecionamento ou validação
        }
    };

    const handleSubmitFuncionario = (e) => {
        e.preventDefault();
        const cpf = document.getElementById('cpf').value;
        const clienteLink = document.getElementById('cliente-vinculado').value;
        if (!cpf || !clienteLink) {
            setShowAlert(true);
        } else {
            setShowAlert(false);
            console.log('CPF enviado:', cpf, 'Cliente vinculado:', clienteLink);
            // Aqui você pode implementar a lógica de redirecionamento ou validação
        }
    };

    return (
        <div className={styles.main}>
            <h1>Área de Login</h1>
            <form className={styles.login_form}>
                {/* Seleção de tipo de login */}
                <label htmlFor="user-type">Selecione o tipo de login:</label>
                <select
                    id="user-type"
                    name="user-type"
                    value={userType}
                    onChange={(e) => setUserType(e.target.value)}
                    required
                >
                    <option value="">Escolha...</option>
                    <option value="cliente">Cliente</option>
                    <option value="funcionario">Colaborador</option>
                </select>

                {/* Seção de Cliente */}
                <div id="cliente-section" style={{ display: 'none' }}>
                    <label htmlFor="cnpj">Digite o CNPJ:</label>
                    <input type="text" id="cnpj" placeholder="Digite o CNPJ" />
                    <p className={styles.aviso}>Sem cadastro? Entre em contato</p>
                    <button className={styles.submit_btn} onClick={handleSubmitCliente}>
                        Acessar Sistema
                    </button>
                </div>

                {/* Seção de Funcionário */}
                <div id="funcionario-section" style={{ display: 'none' }}>
                    <label htmlFor="cpf">Digite o CPF:</label>
                    <input type="text" id="cpf" placeholder="Digite o CPF" />
                    <label htmlFor="cliente-vinculado">Selecione o Cliente Vinculado:</label>
                    <select id="cliente-vinculado">
                        <option value="">Escolha um cliente...</option>
                        <option value="cliente1">Cliente 1</option>
                        <option value="cliente2">Cliente 2</option>
                    </select>
                    <button className={styles.submit_btn} onClick={handleSubmitFuncionario}>
                        Acessar Sistema
                    </button>
                </div>

                {/* Alertas */}
                {showAlert && (
                    <div id="alert" className={styles.alert}>
                        <p className={styles.alertMessage}>Por favor, preencha todos os campos.</p>
                    </div>
                )}
            </form>
        </div>
    );
}

export default ComponentsLogin;
